// detect if user has system preference
const systemSettingDark = window.matchMedia("(prefers-color-scheme: dark)");

const darkModeToggle = document.querySelector("input[name=dark-mode]");
const darkModeToggleContainer = document.querySelector(
  ".dark-mode-toggle-container"
);
const nav = document.getElementsByTagName("nav")[0];

const sideBarToggle = document.querySelector(".side-bar-toggle");
const collapseIcon = document.querySelector(".collapse-icon");

function getThemeFromSettings({ localStorageTheme, systemSettingDark }) {
  if (localStorageTheme !== null) {
    return localStorageTheme;
  }

  if (systemSettingDark.matches) {
    return "dark";
  }

  return "light";
}

const localStorageTheme = localStorage.getItem("theme");

let currentThemeSetting = getThemeFromSettings({
  localStorageTheme,
  systemSettingDark,
});

darkModeToggle.addEventListener("change", function () {
  // console.log(this);
  const newTheme = this.checked ? "dark" : "light";

  // update theme attribute on HTML to switch theme in CSS
  document.querySelector("html").setAttribute("data-theme", newTheme);

  // update in local storage
  localStorage.setItem("theme", newTheme);

  // update the currentThemeSetting in memory
  currentThemeSetting = newTheme;

  // update border style on header element
  nav.style.border = this.checked ? "none" : "2px solid #e2e8f0";
});

