// carousel controls
let currentSlide = 1;
const timer = 6000;
const prevSlideBtn = document.querySelector(".previous-slide");
const nextSlideBtn = document.querySelector(".next-slide");
const slides = document.querySelectorAll(".slide");
const slideBtns = document.querySelectorAll(".slide-btn");

let carouselInterval = setInterval(
  () =>
    updateSlides(
      slides,
      slideBtns,
      (currentSlide = currentSlide + 1 > 3 ? 1 : currentSlide + 1)
    ),
  timer
);

// helper function for updating slides
function updateSlides(slides, slideBtns, id) {
  // check for the slide with id and add the active class
  // while removing the active class from the current slide

  // for the slide btns
  slideBtns.forEach((item) => {
    if (item.classList.contains("active-slide")) {
      item.classList.remove("active-slide");
    }
    if (Number(item.dataset.slideBtnId) === id) {
      item.classList.add("active-slide");
    }
  });

  // for the slides
  slides.forEach((item) => {
    if (item.classList.contains("current-slide")) {
      item.classList.remove("current-slide");
    }
    if (Number(item.dataset.slideId) === id) {
      item.classList.add("current-slide");
    }
  });

  // clear the interval and restart the interval
  clearInterval(carouselInterval);
  carouselInterval = setInterval(
    () =>
      updateSlides(
        slides,
        slideBtns,
        (currentSlide = currentSlide + 1 > 3 ? 1 : currentSlide + 1)
      ),
    timer
  );
}

prevSlideBtn.addEventListener("click", function () {
  currentSlide = currentSlide - 1 < 1 ? 3 : currentSlide - 1;
  updateSlides(slides, slideBtns, currentSlide);
});

nextSlideBtn.addEventListener("click", function () {
  currentSlide = currentSlide + 1 > 3 ? 1 : currentSlide + 1;
  updateSlides(slides, slideBtns, currentSlide);
});

slideBtns.forEach((slideBtn) => {
  slideBtn.addEventListener("click", function () {
    // check if clicked slide is already active
    if (slideBtn.classList.contains("active-slide")) {
      return;
    }

    // if it isn't, update the slides
    updateSlides(slides, slideBtns, Number(slideBtn.dataset.slideBtnId));
  });
});

