// function to create cells for a row in a table
function getCells(data, type) {
  return data
    .map(
      (cell, i) =>
        `<${type} class="${
          i > 0 && i < 3 ? "hide-cells-mobile" : ""
        }">${cell}</${type}>`
    )
    .join("");
}

function createRows(data) {
  return data
    .map(
      (cell, i) =>
        `<tr class="rows" data-toggle="collapsible-row" data-id="${i}" id="row${i + 1}" data-target=".row${i + 1}">
          <td class="cells">
            <button data-btn-id="${i + 1}" aria-label="collapse row${
              i + 1
            }" class="collapse-cell-btn">
            <span class="simple-line-icons--arrow-right"></span>
            </button>
            ${cell["event name"]}
          </td>
          <td class="cells hide-cells-mobile">${cell["date"]}</td>
          <td class="cells hide-cells-mobile">${cell["speaker"]}</td>
          <td class="cells">
            <span class="status-cell" data-status="${cell["status"]}">
              <span class="status-dot" data-status-dot="${cell["status"]}" aria-hidden></span>
              ${cell["status"]}
            </span>
          </td>
        </tr>
        <tr class="collapsible-row row${i + 1}">
          <td class="cells">${cell["speaker"]}</td>
          <td class="cells">${cell["date"]}</td>
        </tr>`
    )
    .join("");
}

function createTable(data) {
  const headings = ["event name", "date", "speaker", "status"];

  // Return some HTML that uses `getCells` to create
  // some headings, but also to create the rows
  // in the tbody.
  return `
    <table>
      <caption class="sr-only">History of events</caption>
      <thead>${getCells(headings, "th")}</thead>
      <tbody>${createRows(data)}</tbody>
    </table>
  `;
}

const tableContainer = document.querySelector(".table-container");

// set theme on page load
document.addEventListener("DOMContentLoaded", function () {
  darkModeToggle.checked = currentThemeSetting === "dark" ? true : false;
  nav.style.border = darkModeToggle.checked ? "none" : "2px solid #e2e8f0";
  document
    .querySelector("html")
    .setAttribute("data-theme", currentThemeSetting);

  tableContainer.insertAdjacentHTML("afterbegin", createTable(eventsHistory));
  const collapseCellBtns = document.querySelectorAll('.collapse-cell-btn')

  const rows = document.querySelectorAll('.rows')

  rows.forEach((row) => {
    row.addEventListener('click', function() {
      console.log('row clicked');
      displayModal(eventsHistory[Number(row.dataset.id)])
    })
  })

  collapseCellBtns.forEach((btn) => {
    btn.addEventListener('click', function(e) {
      e.stopPropagation()
      
      if (btn.children[0].classList.contains('simple-line-icons--arrow-right')) {
        btn.children[0].classList.remove('simple-line-icons--arrow-right')
        btn.children[0].classList.add('simple-line-icons--arrow-down')
      } else {
        btn.children[0].classList.remove('simple-line-icons--arrow-down')
        btn.children[0].classList.add('simple-line-icons--arrow-right')
      }
      document.querySelector(`#row${btn.dataset.btnId}`).classList.toggle('row-toggled')
      document.querySelector(`.row${btn.dataset.btnId}`).classList.toggle('show-collapsible-row')
    })
  })
});

